import React, {Component} from 'react';
import {Tab, Tabs, TabList, TabPanel} from 'react-tabs';
import {NavLink} from 'react-router-dom';

class TheEnd extends Component{
  constructor(props){
    super(props);
    this.state = {
      chapterlists: []
    };
  }
  componentDidMount() {
    fetch('/api/ChaptersForStory/all')
    .then(response => response.json())
    .then(data => this.setState({chapterlists: data.chapterlists}));
  }
  render(){
    const {chapterlists} = this.state;
    return(
      <div>
        <Tabs>
          <TabList>
            <Tab>Your Progress</Tab>
            <Tab>Compare Stats</Tab>
            <Tab>The End Tab</Tab>
          </TabList>
          <TabPanel>
            <p>
              Test1 Progress
            </p>
            <div className='progressContainer'>
            <ul className='progressList'>
            {chapterlists.map(chapterlist =>
              <li className='progressBox'>
                <div>Chapter: {chapterlist.chapterNum}</div>
                <div>Title: {chapterlist.title}</div>
              </li>
            )}
            </ul>
            </div>
          </TabPanel>
          <TabPanel>
            <p>
              Test2 Stats
            </p>
              <div className='statsContainer'>
                <div className='statsBars'></div>
                <div className='statsBars'></div>
                <div className='statsBars'></div>
                <div className='statsBars'></div>
                <div className='statsBars'></div>
              </div>
          </TabPanel>
          <TabPanel>
            <NavLink to='/' activeClassName='exitLink'><button className='btn draw-border'>Exit back to the beginning</button></NavLink>
          </TabPanel>
        </Tabs>
      </div>
    );
  }
}


export default TheEnd;
